import React, { useState } from 'react';
import { Container, Row, Col, Button, ButtonGroup} from 'react-bootstrap';
import ShowExpedients from './ShowExpedients';

const Expedients = (props) => {
  const [vista, setVista] = useState(false);
  const [expedientes , setExpedientes] = useState([
   {id: 1, nombre: "Agua azul"},
   {id: 2, nombre: "LA VOLCADA DEL OESTE"}
  ]);

  return (
    <Container>
    	<Row>
            <Col>
                <h4 className="text-primary font-weight-bold mb-3 ml-2">
                    Expedientes
                </h4>   
            </Col>
            <Col sm={4}>
                <ButtonGroup>
                  <Button variant="primary">Lista</Button>
                  <Button variant="primary">Cuadricular</Button>
                </ButtonGroup>
            </Col>
    	</Row>
        <ShowExpedients expedientes={expedientes} />
    </Container>
  )
}

export default Expedients;
